// src/components/About.js
import React from 'react';
import './About.css';

function About() {
  return (
    <section id="about" className="About">
      <h2>About Me</h2>
      <p>I'm a web developer with a passion for creating amazing user experiences.</p>
    </section>
  );
}

export default About;
